import { useEffect, useState } from "react";

function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetch("http://localhost:4000/api/admin/orders", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) {
          setOrders(data);
        } else {
          setOrders([]);
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error("Admin fetch error:", err);
        setLoading(false);
      });
  }, [token]);

  if (loading) return <div className="container mt-4">Loading...</div>;

  return (
    <div className="container mt-4">
      <h2 className="mb-4">ðŸ“¦ Admin Dashboard</h2>
      {orders.length === 0 ? (
        <p>No orders found.</p>
      ) : (
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(auto-fit, minmax(350px, 1fr))",
            gap: "20px",
          }}
        >
          {orders.map((o) => (
            <div
              key={o._id}
              style={{
                border: "1px solid #ddd",
                borderRadius: "12px",
                padding: "20px",
                background: "#fff",
                boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
              }}
            >
              <h5 style={{ color: "#007bff" }}>Order ID: {o._id}</h5>
              <p>
                <strong>Customer:</strong> {o.customerName} <br />
                <strong>Email:</strong> {o.customerEmail} <br />
                <strong>Phone:</strong> {o.customerPhone}
              </p>

              <p>
                <strong>Address:</strong> <br />
                {o.customerAddress?.line1}, {o.customerAddress?.city},{" "}
                {o.customerAddress?.state} - {o.customerAddress?.postal_code}
                <br />
                {o.customerAddress?.country}
              </p>

              <div>
                <strong>Products Ordered:</strong>
                <ul style={{ paddingLeft: "20px" }}>
                  {Array.isArray(o.items) &&
                    o.items.map((p, i) => (
                      <li key={i}>
                        {p.name} (x{p.quantity}) â€“ â‚¹{p.price}
                      </li>
                    ))}
                </ul>
              </div>

              <p>
                <strong>Total:</strong>{" "}
                <span style={{ color: "green", fontSize: "18px" }}>
                  â‚¹{o.totalAmount}
                </span>
              </p>

              <p style={{ fontSize: "12px", wordBreak: "break-word" }}>
                <strong>Session ID:</strong> {o.stripeSessionId}
              </p>

              <p style={{ fontSize: "13px", color: "gray" }}>
                {new Date(o.createdAt).toLocaleString()}
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default AdminDashboard;
